import React, { Component } from "react";
import { connect } from "react-redux";
import { Row, Col, Card, CardBody } from "reactstrap";

import { getLoggedInUser } from "../../helpers/authUtils";
import Loader from "../../components/Loader";
import ServiceForm from "./Form/ServiceForm";

import ServiceItemService from "../../services/ServiceItemService";

let id = "";

class ServiceEdit extends Component {
  constructor({ match, props }) {
    super(props);
    this.state = {
      user: getLoggedInUser(),
      _id: "",
      title: "",
      phone: "",
      typeServiceId: "",
      address: "",
      opened: [],
      // services: [],
      isFetching: false,
      error: null,
      successMsg: null,
      isFetchingSub: false,
      errorSub: null,
      successMsgSub: null
    };
    id = match.params.id;
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  componentDidMount() {
    this.getService();
  }

  getService() {
    const { token } = this.state.user;
    ServiceItemService.getService(id, token)
      .then(response => {
        this.setState({
          _id: response.data._id,
          title: response.data.title,
          phone: response.data.phone,
          typeServiceId: response.data.typeServiceId,
          address: response.data.address,
          opened: response.data.opened,
          image: response.data.image,
          published: response.data.published
        });
      })
      .catch(error => {
        this.setState({ error: "erro", isFetching: false });
      });
  }

  handleSubmit(value) {
    const { _id, title, phone, typeServiceId, address, opened } = value;

    // if (!title) return false;
    // if (!phone) return false;

    this.setState({
      _id,
      title,
      phone,
      typeServiceId,
      address,
      opened,
      isFetching: true,
      error: null,
      successMsg: null
    });

    const { token } = this.state.user;

    let service = {
      _id,
      title,
      phone,
      typeServiceId,
      address,
      opened
    };

    ServiceItemService.updateService(service, token)
      .then(response => {
        if (response.status === true) {
          let message = "Success to update the service.";
          this.setState({ successMsg: message, isFetching: false });
        } else {
          this.setState({
            error: "Error",
            isFetching: false,
            successMsg: false
          });
        }
      })
      .catch(error => {
        this.setState({ error: error, isFetching: false, successMsg: false });
      });
  }

  render() {
    const {
      _id,
      title,
      phone,
      typeServiceId,
      address,
      opened,
      image,
      published
    } = this.state;

    let service = {
      _id,
      title,
      phone,
      typeServiceId,
      address,
      opened,
      image,
      published
    };

    return (
      <React.Fragment>
        <div className="service">
          {this.props.loading && <Loader />}
          <Row>
            <Col>
              <div className="page-title-box">
                <Row>
                  <Col lg={7}>
                    <h4 className="page-title">Edit Service</h4>
                  </Col>
                  <Col lg={5} className="mt-lg-3 mt-md-0"></Col>
                </Row>
              </div>
            </Col>
          </Row>
          <Row>
            <Col lg={12}>
              <Card>
                <CardBody>
                  <Row>
                    <Col lg={3} />
                    <Col lg={6}>
                      <ServiceForm
                        edit={true}
                        handleSubmit={this.handleSubmit}
                        error={this.state.error}
                        successMsg={this.state.successMsg}
                        isFetching={this.state.isFetching}
                        service={service}
                      />
                    </Col>
                    <Col lg={3} />
                  </Row>
                </CardBody>
              </Card>
            </Col>
          </Row>
        </div>
      </React.Fragment>
    );
  }
}

export default connect()(ServiceEdit);
